import React, { Component } from 'react';
import './Profile.css';
import store from "../../redux/state";




const Profile = () => {
    return (
        <nav className='profile'>

         <div className='item'><img src={store._state.ProfileInfo[0].avatar}/></div>

    <b><div>{store._state.ProfileInfo[0].name}</div></b>
        <div> {store._state.ProfileInfo[0].job}</div>
            <div> {store._state.ProfileInfo[0].city}</div>
        <br></br>
        <div>Подписок:</div>
        <div><b>34</b></div>
        <br></br>
        <div>Подписчиков:</div>
        <div><b>155</b></div>
        <br></br>
       <div className='item'><b>Посмотреть профиль</b></div>
      </nav>
    )
}

export default Profile;
